import React from 'react';


function ParkGallery ({ parks }){

    return (

      <ul className="cards">{parkData}>

      {parks.map((park) => {
        return (
        <img 
        className = "gallery" 
        alt = {park.images} 
        key = {park.id} 
        src = {park.images[0].url}
        />
        );
      })}
    </ul>
    );
    }






